// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./implementations/PodToken.sol";
import "./implementations/CopyrightToken.sol";
import "./implementations/ERC721WithRoyalty.sol";
import "./PodWithdrawManager.sol";
import "./Governance.sol";
import "./CreationManager.sol";
import "./Structs.sol";

/**
 * @title pod contracts deployer and manager
 * @author Eric Nordelo
 */
contract PodManager is AccessControl, Pausable, ReentrancyGuard {
    using Counters for Counters.Counter;

    uint256 public constant PRECISION = 10000;
    bytes32 public constant FUNDING_STATE = keccak256("FUNDING_STATE");
    bytes32 public constant FUNDED_STATE = keccak256("FUDED");
    bytes32 public constant DISPOSED_STATE = keccak256("DISPOSED");
    bytes32 public constant ADMIN = keccak256("ADMIN");
    // bytes32 public constant WITHDRAW_MANAGER_ROLE = keccak256("WITHDRAW_MANAGER_ROLE");

    address private immutable podWithdrawManagerAddress;
    address private immutable governanceAddress;
    address private immutable creationManager;

    mapping(address => PodInfo) private _pods;
    mapping(address => uint256) private _podTokensClaimable;
    mapping(address => uint256) private _podTokensStaked;

    uint256 private nextProposalId = 0;
    mapping(uint256 => PodProposal) public podProposals;
    mapping(uint256 => mapping(address => bool)) private podProposalToAccountToVoted;

    event PodProposalCreated(uint256 id);
    event ProposalVoted(uint256 id, address voter);
    event CreatePod(address indexed podAddress);
    event InvestPod(address indexed investor, address indexed podAddress, uint256 amount);
    event UploadMedia(address indexed podAddress, uint256 nftId, uint256 _mediaId);
    event DisposePod(address indexed podAddress);

    constructor(
        address _podWithdrawManagerAddress,
        address _governanceAddress,
        address _creationManager
    ) {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN, msg.sender);

        podWithdrawManagerAddress = _podWithdrawManagerAddress;
        governanceAddress = _governanceAddress;
        creationManager = _creationManager;
    }

    /**
     * @notice allows admins to pause the contract
     */
    function pause() external onlyRole(ADMIN) {
        _pause();
    }

    /**
     * @param _copyrightAllocation order must match _pod.owners + last position for investors
     */
    function registerPodProposal(
        Pod memory _pod,
        uint256[] calldata _mediaIds,
        uint256 _royaltyPercentage,
        PodDescription calldata _podDescription,
        uint256 _copyrightTokenSupply,
        uint256[] calldata _copyrightAllocation
    ) external whenNotPaused {
        require(_pod.spread > 0 && _pod.spread < PRECISION, "Invalid spread");
        require(_pod.fundingTokenPrice > 0, "Invalid Token Price");
        require(_pod.owners.length > 0, "No owners");
        require(_mediaIds.length > 0, "No medias");
        require(_copyrightAllocation.length == _pod.owners.length + 1, "Invalid copyright allocation");
        uint256 copyrightAllocationSum;
        for (uint256 i = 0; i < _copyrightAllocation.length; i += 1) {
            copyrightAllocationSum += _copyrightAllocation[i];
        }
        require(copyrightAllocationSum == 100, "Wrong copyright allocation");

        podProposals[nextProposalId] = PodProposal({
            pod: _pod,
            start: block.timestamp,
            votes: 0,
            mediaIds: _mediaIds,
            royaltyPercentage: _royaltyPercentage,
            podDescription: _podDescription,
            copyrightTokenSupply: _copyrightTokenSupply,
            copyrightAllocation: _copyrightAllocation
        });

        emit PodProposalCreated(nextProposalId);

        nextProposalId += 1;
    }

    function voteForPodProposal(uint256 id) external whenNotPaused {
        require(
            block.timestamp - podProposals[id].start <= Governance(governanceAddress).getPodVotingPeriod(),
            "Voting period ended"
        );
        require(!podProposalToAccountToVoted[id][msg.sender], "Account already voted");
        bool senderFoundInOwners = false;
        for (uint256 i = 0; i < podProposals[id].pod.owners.length; i += 1) {
            if (podProposals[id].pod.owners[i] == msg.sender) {
                senderFoundInOwners = true;
            }
        }
        require(senderFoundInOwners, "Only owners can vote");

        podProposals[id].votes += 1;
        podProposalToAccountToVoted[id][msg.sender] = true;

        emit ProposalVoted(id, msg.sender);
    }

    function executePodProposal(uint256 id) external whenNotPaused {
        PodProposal memory _podProposal = podProposals[id];
        Pod memory _pod = _podProposal.pod;
        require(podProposals[id].votes == _pod.owners.length, "Proposal not accepted");
        require(_pod.fundingDate >= block.timestamp, "Funding date in the past");

        address podAddress = CreationManager(creationManager).createPodToken(
            _podProposal.podDescription.podTokenName,
            _podProposal.podDescription.podTokenSymbol
        );
        _pod.podAddress = podAddress;

        address copyrightToken = CreationManager(creationManager).createCopyrightToken(
            string(abi.encode(_podProposal.podDescription.podTokenName, " Copyright")),
            string(abi.encode(_podProposal.podDescription.podTokenSymbol, "C")),
            _pod.owners,
            _podProposal.copyrightAllocation,
            _podProposal.copyrightTokenSupply
        );

        address erc721WithRoyalty = CreationManager(creationManager).createErc721WithRoyalty(
            _podProposal.podDescription.podTokenName,
            _podProposal.podDescription.podTokenSymbol,
            podAddress,
            _podProposal.royaltyPercentage
        );

        _pods[podAddress] = PodInfo({
            status: FUNDING_STATE,
            mediaIds: _podProposal.mediaIds,
            registeredMediaIds: new uint256[](0),
            raisedFunds: 0,
            nftContract: erc721WithRoyalty,
            pod: _pod,
            copyrightToken: copyrightToken,
            copyrightSupplyInvestors: _podProposal.copyrightAllocation[
                _podProposal.copyrightAllocation.length - 1
            ]
        });

        // save the pod owners
        PodWithdrawManager(podWithdrawManagerAddress).savePodOwners(podAddress, _pod.owners);

        emit CreatePod(podAddress);
    }

    /**
     * @notice allows investors to invest on a pod
     * @dev using check-effect-interaction pattern to avoid reentrancy
     * @param _podAddress the address of pod
     * @param _amount the amount to invest
     */
    function investPod(address _podAddress, uint256 _amount) external whenNotPaused {
        require(_amount > 0, "Invalid amount");

        // get pod info
        PodInfo memory podInfo = getPodInfo(_podAddress);

        // solhint-disable-next-line
        require(podInfo.pod.fundingDate >= block.timestamp, "Funding date in the past");
        require(podInfo.status == FUNDING_STATE, "Invalid status");

        uint256 amountToInvest = podInfo.pod.fundingTarget - podInfo.raisedFunds;
        if (_amount < amountToInvest) {
            amountToInvest = _amount;
        }

        uint256 tokensToReturn = (amountToInvest * PRECISION) / podInfo.pod.fundingTokenPrice;
        require(tokensToReturn > 0, "0 tokens to return");

        // update pod status
        if (podInfo.raisedFunds + amountToInvest >= podInfo.pod.fundingTarget) {
            _pods[_podAddress].status = FUNDED_STATE;
        }
        _pods[_podAddress].raisedFunds += amountToInvest;

        // make the transfers (should have the allowance)
        require(
            ERC20(podInfo.pod.fundingToken).transferFrom(msg.sender, _podAddress, amountToInvest),
            "Fail to transfer funds"
        );

        _podTokensClaimable[msg.sender] += tokensToReturn;

        emit InvestPod(msg.sender, _podAddress, amountToInvest);
    }

    function claimPodTokens(address _podAddress) external nonReentrant {
        PodInfo memory podInfo = getPodInfo(_podAddress);
        require(podInfo.pod.fundingDate >= block.timestamp, "Funding date in the past");
        require(podInfo.raisedFunds >= podInfo.pod.fundingTarget, "Funding target not reached");

        PodToken(podInfo.pod.podAddress).mint(msg.sender, _podTokensClaimable[msg.sender]);

        uint256 totalSupplyPodTokens = PodToken(podInfo.pod.podAddress).totalSupply();
        uint256 copyrightTokensToSend = (podInfo.copyrightSupplyInvestors * _podTokensClaimable[msg.sender]) /
            totalSupplyPodTokens;
        CopyrightToken(podInfo.copyrightToken).mint(address(this), copyrightTokensToSend);

        delete _podTokensClaimable[msg.sender];
    }

    function stakePodTokens(address _podAddress, uint256 amount) external {
        PodInfo memory podInfo = getPodInfo(_podAddress);
        require(podInfo.pod.fundingDate >= block.timestamp, "Funding date in the past");
        require(podInfo.status == FUNDED_STATE, "Pod not in funded state");

        _podTokensStaked[msg.sender] += amount;
        require(
            PodToken(podInfo.pod.podAddress).transferFrom(msg.sender, address(this), amount),
            "Transfer failed"
        );
    }

    /**
     * @notice allows media creators to upload a new media to a given pod
     */
    function uploadMedia(address _podAddress, uint256 _mediaId) external {
        require(_pods[_podAddress].status != DISPOSED_STATE, "Unexisten or invalid pod");
        require(isOwner(_podAddress, msg.sender), "Only owners can upload the Media");
        require(isUploadedMedia(_podAddress, _mediaId), "Media id is wrong or already uploaded");

        // get pod info
        PodInfo memory podInfo = getPodInfo(_podAddress);

        ERC721WithRoyalty(podInfo.nftContract).mint(
            _podAddress,
            _pods[_podAddress].registeredMediaIds.length + 1
        );
        _pods[_podAddress].registeredMediaIds.push(_mediaId);

        // emit the event if the creation was successful
        emit UploadMedia(_podAddress, _pods[_podAddress].registeredMediaIds.length + 1, _mediaId);
    }

    /**
     * @notice allows the disposing of a pod when funding target is not reached
     */
    function disposePod(address _podAddress) external {
        PodInfo memory podInfo = getPodInfo(_podAddress);

        if (podInfo.raisedFunds < podInfo.pod.fundingTarget && podInfo.pod.fundingDate > block.timestamp) {
            revert("Undisposable pod");
        }

        // set the status to disposed
        _pods[_podAddress].status = DISPOSED_STATE;

        // emit the event if the dispose was successful
        emit DisposePod(_podAddress);
    }

    /**
     * @dev helper to get a pod checking if exists
     */
    function getPodInfo(address _podAddress) public view returns (PodInfo memory podInfo) {
        require(_pods[_podAddress].mediaIds.length > 0, "Unexistent pod");
        podInfo = _pods[_podAddress];
    }

    function isOwner(address podAddress, address account) public view returns (bool) {
        for (uint256 i = 0; i < _pods[podAddress].pod.owners.length; i += 1) {
            if (_pods[podAddress].pod.owners[i] == account) {
                return true;
            }
        }
        return false;
    }

    function isUploadedMedia(address podAddress, uint256 mediaId) public view returns (bool) {
        for (uint256 i = 0; i < _pods[podAddress].registeredMediaIds.length; i += 1) {
            if (_pods[podAddress].registeredMediaIds[i] == mediaId) {
                return true;
            }
        }
        return false;
    }
}

